description:
&quot;This film follows the lives of four teenaged girls adopted from China and now living in the United States. In profiling Chinese adoptees in contemporary America, Linda Goldstein Knowlton has created a deeply moving documentary illustrating that even the most specific of experiences can be universally relatable.&quot;  

